import React, { Component } from 'react';
import Axios from 'axios';

class exerciseList extends Component {
    constructor(props) {
        super(props)

        this.state = {
            exercise:[]
        }
    }

    componentDidMount() {
        axios.get('http://localhost:5000/exerxise')
            .then(res => {
                this.setState({
                exercise:res.data
            })
            })
        .catch(err=>{})
    }

    render() {
        return <div>exerciseList</div>;
    }
}

export default exerciseList;
